import { useEffect, useState } from "react";
const Details = (quest) => {
  const [activeObj, setActiveObj] = useState();

    useEffect(() => {
        if (
            quest["quest"] === undefined ||
            quest["quest"] === null ||
            quest === undefined ||
            quest === null ||
            quest["quest"]["quest"] === undefined ||
            quest["quest"]["quest"] === null
          ) {
            setActiveObj("")
          } else {
            setActiveObj(quest['quest']['quest']['name'])
          }
    })


  return (
    <>
      <h1>Details</h1>
      <Card title={activeObj} style={{ width: "25rem", marginBottom: "2em" }}>
        <p className="m-0" style={{ lineHeight: "1.5" }}>
          Lorem ipsum dolor sit amet, consectetur adipisicing elit. Inventore
